function Form() {
    const handleSubmit = event => {
        event.preventDefault();
        alert('Formularz kontaktowy wysłany')
    }

    return(
        <div className="form">
            <h1 className="opening_header">Dane techniczne:</h1>
            <form onSubmit={handleSubmit}>
                <fieldset>
                    <label>
                        <p>Imie</p>
                        <input name="Imie" />
